var socket=io();socket.on("Data",function(e){for(var t=Object.keys(e),a=Object.values(e),c=document.getElementById("tarjetas"),d=1;d<=100;d++)document.getElementById(`card${d}`)&&document.getElementById(`card${d}`).remove();for(d=1;d<=t.length;d++){var r=document.createElement("div");r.className="card",r.id="card"+d,r.innerHTML=`<div class="card-body"><h6 class="text-center card-title" id="titulo${d}">${t[d-1]}</h4><p class="text-center card-text" id="valor${d}">${a[d-1]}</p></div>`,c.append(r)}});